# -*- coding: utf-8 -*-

__capability__ = 6

def arp_fromconfig(cmd, *args, **argv):
    """
    """
    
    context = argv["context"]

    from _arp_deal import arp_reset as fromconfig_arp
    
    exit_state = fromconfig_arp()
    if exit_state == True:
        return
    else:
        context.write("%s" % exit_state)

